const TaskView = (props) => {

    return (
        <div className="viewTaskArea">
        <table>
            <thead>
                <tr>
                    <th>ID</th>
                    <th>コメント</th>
                    <th>状態</th>
                </tr>
            </thead>
            <tbody id="todoBody">
                {/* taskの表示 */}
                {props.todoList.map((todo, index) => {
                return (
                <tr key={index+1}>
                    <td>{index+1}</td>
                    <td>{todo}</td>
                    <td>
                        <button>作業中</button>
                        <button>削除</button>
                    </td>               
                </tr>
                ); //return 
                })}
            </tbody>
        </table>
        </div>
    );

}

export default TaskView
